  * MediaQueryActivation no longer intercepts/hooks directive::onMediaQueryChanges
  * rename media-query-activation to ''responsive-activation''
* simplify ngOnChanges code and access to mediaMonitor
* rename raw breakpoint list to RAW_DEFAULTS
