  [class.xs]="[''xs-1'', ''xs-2'']"

  [style]="{''font-size'': ''10px'', ''margin-left'' : ''13px''}"

  [style.xs]="{''font-size'': ''16px''}"

  [style.md]="{''font-size'': ''12px''}">

</div>

```



```html

<div  fxLayout

  [ngClass.xs]="[''xs-1'', ''xs-2'']"

  [ngStyle]="{''font-size'': ''10px'', ''margin-left'' : ''13px''}"

  [ngStyle.xs]="{''font-size'': ''16px''}"

  [ngStyle.md]="{''font-size'': ''12px''}">

