INSERT INTO public."Commits"
VALUES (714, '635c4f587037cb8a86af8f07d9e76e0f077e833c', 'fix(flexbox): scan flex-direction in css stylesheet (#365)

`fxFlex` works best if the parent container has flexbox styles assigned (display, flex-direction, etc.). If not assigned (inline or via stylesheet), then these styles are auto-injected inline on the DOM parent element.



When scanning parent DOM element for flexbox flow direction, first scan the in element''s inline style and then scan the computed stylesheet for the `flex-direction` value.



> It is assumed that if the parent element has a `flex-direction` style property set, then the other required properties (display, border-box, etc.)  have also been assigned.



Fixes #272, #364.', '2017-08-07 20:29:56', 7, 4, NULL);
INSERT INTO public."Commits"
VALUES (715, '37a0b85c82c5b0b65614db050703f3ec8bdeb6b1', 'fix(breakpoints): support print media (#367)

Previous breakpoints defined mediaQueries like `screen and (max-width: 599px)`. This means that

all responsive layouts (using .xs, .sm, etc.) will not print properly since `@media print` is excluded

by the `screen and ...` breakpoint definitions.



Remove all `screen and ` @media prefixes; so the layouts will appear the same on both display and print devices.



Fixes #361.', '2017-08-07 21:46:10', 7, 4, NULL);
INSERT INTO public."Commits"
VALUES (716, 'f0473e99bf8459f229804c9e526aa9d1d6ac4748', 'fix(fxFlexOffset): use parent flow direction for margin property (#369)

`fxFlexOffset` assigns inline `margin-left` style; assuming default flow directions == ''row''. If the parent flow direction == ''column'', then a `margin-top` should be used.



Also added a subscription to an optional parent element LayoutDirective; which will trigger the FlexOffsetDirective to update the inline styles to match the current flow direction.



> Note: if `fxFlexOffset` is used **without**  a parent flexbox styling (set via css or directive), then a `display:flex; flex-direction:row;` will be auto assigned to the fxFlexOffset host element''s parent.



Fixes #328.', '2017-08-09 15:33:56', 7, 4, NULL);
INSERT INTO public."Commits"
VALUES (717, '9fb08772619e90b26b38ec9797bac08fa7410752', 'fix(fxLayoutGap): mutation observer should run outside the ngZone (#370)

Inside the ngZone, the mutation observer and _updateWithValue() style changes causes an infinite recursion. MutationObserver handlers should be executed outside the ngZone.



Fixes #329.', '2017-08-09 15:55:22', 7, 4, NULL);
INSERT INTO public."Commits"
VALUES (718, '695bf371f96363a41b4bf14bbb8653f0b624dca2', 'refactor(api): use Renderer2 instead of Renderer (#372)

* fix(api): getDisplayStyle() defaults to ''inline''



* refactor(api): use Renderer2 instead of Renderer



* Use Renderer2 instead of Renderer

