INSERT INTO public."Commits"
VALUES (944, '8307655f9d677f16d5a03aa139d71ccfb3a96cf2', 'feat(core): MediaObserver can report 1..n activations (#994)

Previous versions of MediaObserver suffered from a significant design flaw. 



Those versions assumed that a breakpoint change would only activate/match a single mediaQuery. Additionally those versions would not (by default) report overlapping activations. Applications interested in notifications for all current activations would therefore not receive proper event-notifications.



The current enhancements provide several features:



* Report 1..n mediaQuery activations (matches === true) in a single event

* Report activations sorted by descending priority

* By default, reports include overlapping breakpoint activations

* Debounce notifications to a single grouped event

  > useful to reduce browser reflow thrashing



BREAKING CHANGE:



The stream data type for `asObservable` is now **MediaChange[]** instead of *MediaChange* and `media$` is deprecated in favor of `asObservable()`. 



* `filterOverlaps` now defaults to `false`

', '2019-01-15 05:17:06', 13, 4, NULL);
INSERT INTO public."Commits"
VALUES (945, '47248b1e4041b38cc478527a754a3ef71fd311fc', 'fix(ngClass): should properly remove classes without fallback (#995)

In some cases where a fallback `ngClass` is not defined, the ClassDirective had no way of knowing to remove its ngClass on deactivation. 



> Unlike other directives, the `removeStyles` action has no effect on ClassDirective.



By specifying an empty default fallback, we ensure that on deactivation - if no other default is specified - the ClassDirective will correctly fallback to an empty string case.





Fixes #992.', '2019-01-15 14:18:41', 1, 4, NULL);
INSERT INTO public."Commits"
VALUES (946, 'c45f2ae0b44ab8f29a4ff9bb858c5cf3d0aae71f', 'refactor(core): create generic sort operations (#996)

* improve performance with `MediaObserver::media$` property', '2019-01-15 15:50:19', 1, 4, NULL);
INSERT INTO public."Commits"
VALUES (947, '53a6ebba30a68f0f3dcf2a8c3e458260ae049d5f', 'feat(core): move MatchMedia to internal scope (#998)

BREAKING CHANGE:



`MediaObserver` is the only supported mechanism to watch breakpoint activations outside the library. Developers should not use `MatchMedia`.



*  MatchMedia is no longer exported as a public utility. 

*  ServerMatchMedia is no longer exported at all', '2019-01-15 20:46:20', 1, 4, NULL);
INSERT INTO public."Commits"
VALUES (948, '66e74634430843f1735644575ea47084da605d53', 'feat(core): implement MediaTrigger to allow manual breakpoint activations (#997)

The Windows MatchMedia API announces breakpoint activations during viewport resizing.

For some scenarios, developers need support for manual activations (without resizing). 



Such features are useful for:

* for SSR

* for designer environments 

  > for immediate rendering of layouts for specific (1..n) breakpoints

', '2019-01-15 22:40:08', 2, 4, NULL);
INSERT INTO public."Commits"
VALUES (949, '1c136bce3b05ef55dde016f6f55ff0b3c7ff424a', 'feat(server): add ability to specify breakpoints for MediaObserver (#999)

On the server, there is no conception of "browser window," because Angular''s

browser implementation doesn''t implement it. This means MatchMedia breakpoint activations will not work on the server. 



Layout SSR will generate CSS Stylesheets for all known breakpoints. And for the static, delivered-first HTML pages the directives are replaced with their associated, generated CSS classnames. 



But for programmatic usages of `MediaObserver`, we don''t have a fallback mechanism to *announce* breakpoint activations. This PR allows a user to specify which activations they want to trigger via the MediaObserver for programmatic view listeners.



This can be done using the following configuration:



```ts

FlexLayoutModule.withConfig({serverBreakpoints: [''xs'', ''lt-md'']})

```



Fixes #991 .', '2019-01-16 19:05:53', 1, 4, NULL);
INSERT INTO public."Commits"
VALUES (950, '1154faea3e8cb50d24805b9aaab9e56e71bcd6f6', 'fix(core): update breakpoint ranges to remove subpixel gaps (#1004)

