INSERT INTO public."Commits"
VALUES (957, 'ce9b9892c32e1b8465f842d107c4aaa475eacd43', 'fix(fxLayoutGap): correctly handle lack of fallback value (#1037)

In most directives, style generation and removal happens in

a contained cycle: styles are generated, cached, and then

removed when no longer needed. This is facilitated by caching

the results of the `StyleBuilder`s for each directive in a

local object on the directive, and then removing those styles

when called.



In the case of `fxLayoutGap`, most of the style generation is

applied to the children, and so in most cases just removing the

parent styles is insufficient, and in other cases, just

ineffective (because no parent styles are actually generated).

To fix this, we override the default style clearing method,

and replace it with one that actually removes the child styles

(and the parent styles if any are present).



Fixes #1011 ', '2019-03-17 01:02:42', 2, 4, NULL);
INSERT INTO public."Commits"
VALUES (958, 'b24522945b8bdf66dd587de118a8d0ead8be8d19', 'fix(fxFlex): restore correct styles after fxLayoutAlign is applied (#1038)

There is currently a race condition when `fxFlex` and `fxLayoutAlign`

are present on the same element. Both directives end up injecting

`max-width`/`max-height` stylings onto their host element, which

leads to a conflict when both are present.



The intended behavior is to have child elements take precandence

due to their higher specificity/importance, so this commit adds

a watcher for a sibling `fxLayoutAlign` in `fxFlex` to retrigger

styles.



Fixes #1038', '2019-03-17 02:18:55', 2, 4, NULL);
